import "./App.css";
import { Task } from "./components/task.tsx";

function App() {
  return (
    <Task
      name="UIUX Course"
      dueDate={new Date()}
      important={false}
      repeat={false}
      completed={true}
      taskID="1"
    />
  );
}

export default App;
